import {
  useEffect
} from "react";

import $ from 'jquery';
const Paginate = ()=>{

  const getData = ()=>{
    $.ajax({
      type: "GET",
      url: "https://jsonplaceholder.typicode.com/photos?_start=0&_limit=5",
      success: (response)=>{
        console.log(response)
      }

    });
  }

  useEffect(getData,[]);
  const design = (
    <>
      <div className="container">
      
      </div>
    </>
  );
  return design;
}

export default Paginate;
